// import './main.css';
import Navbar from './Navbar';
import Cards from './Cards';

function App() {
  const arr = Cards;
  return (<>
    <h1 className = "tittle">Hello I am Harsh Bhatnagar</h1>
    <div className = "WholeSection">
    <div className = "leftmenu">

    </div>
    <div className = "cards">
    {Cards.map((val,index)=>{
      return(
        <Navbar
          key = {index}
          images = {val.link}
          title = {val.title}
          date = {val.Date}
        />
      )
    })}

    </div>
    </div>
    </>
  );
}

export default App;
